    def predict(self, ins):
        
        ins = np.atleast_1d(ins)
        
        hidden_1 = self.bias_1 + np.matmul(self.w_in_1, ins)
        np.tanh(hidden_1)
        
        hidden_2 = self.bias_2 + np.matmul(self.w_in_2, ins) + np.matmul(self.w_1_2, hidden_1)
        np.tanh(hidden_2)
        
        hidden_3 = self.bias_3 + np.matmul(self.w_in_3, ins) + np.matmul(self.w_1_3, hidden_1) + np.matmul(self.w_2_3, hidden_2)
        np.tanh(hidden_3)
        
        hidden_4 = self.bias_4 + np.matmul(self.w_in_4, ins) + np.matmul(self.w_1_4, hidden_1) + np.matmul(self.w_2_4, hidden_2) + np.matmul(self.w_3_4, hidden_3)
        np.tanh(hidden_4)
        
        outs = self.bias_out + np.matmul(self.w_in_out, ins) + np.matmul(self.w_1_out, hidden_1) + np.matmul(self.w_2_out, hidden_2) + np.matmul(self.w_3_out, hidden_3) + np.matmul(self.w_4_out, hidden_4)
        
        return outs


